objects.on_create:
animate (this, 7, 4);
await timeout (4*3, this);
createTile(this.x / tile_size - 1, this.y / tile_size, "tip left");

await timeout(6, this);
this.sprite_y=7;
animate (this,7,4);
await timeout(4, this);
createTile(this.x / tile_size - 1, this.y / tile_size, "tip left");

await timeout(6, this);
this.sprite_y=6;
animate (this,7,4);
await timeout(4, this);
createTile(this.x / tile_size, this.y / tile_size + 1, "tip down");

levels.on_start:
player.money = 30;
setStatus('$' + player.money);

while(true) {
  await timeout(5, this);
  player.money += 1;
  setStatus('$' + player.money);
}

plant.on_collide:
this.health -= 50;
if (this.health <= 0) {
  this.is_dead = true;
  while (this.sprite_x > 2) {
    await timeout(0.2, this);
    this.sprite_x--;
  }
}

plant left.on_create:
await timeout(6, this);
this.sprite_y=7;
animate (this,7,4);
await timeout(4, this);
createTile(this.x / tile_size - 1, this.y / tile_size, "tip left");

plant down.on_create:
await timeout(6, this);
this.sprite_y=6;
animate (this,7,4);
await timeout(4, this);
createTile(this.x / tile_size, this.y / tile_size + 1, "tip down");

plant right.on_create:
await timeout(6, this);
this.sprite_y=5;
animate (this,7,4);
await timeout(4, this);
createTile(this.x / tile_size + 1, this.y / tile_size, "tip right");

plant up.on_create:
await timeout(6, this);
this.sprite_y=4;
animate (this,7,4);
await timeout(4, this);
createTile(this.x / tile_size, this.y / tile_size - 1, "tip up");

tip left.on_create:
for (var i = 0; i < 7; i++) {
  await timeout(4, this);
  this.sprite_x++;

  if (i == 2 && !this.is_dead)
    createTile(this.x / tile_size - 1, this.y / tile_size, "tip left");
}

cement.on_mouse enter:
setCursor("pointer");
// var gun = createTile (this.x * tile_size, this.y * tile_size, "gun", 3);
// gun.opacity = 0.3;

cement.on_mouse leave:
setCursor ("default");
// var gun = getTile (this.x / tile_size, this.y / tile_size, 3);
// deleteTile (gun);

cement.on_click:
if (player.money < 10)
  return;
player.money -= 10;
setStatus('$' + player.money);

createTile (this.x / tile_size, this.y / tile_size, "gun",3);
createTile (this.x / tile_size, this.y / tile_size -1, "gun above",3);
createTile (this.x / tile_size, this.y / tile_size + 1, "gun below",3);

gun.on_create:
while (true) {
  await timeout (2, this);
  var bullet = createTile (this.x / tile_size, this.y / tile_size, "bullet");
  bullet.vel_y=2
}

tip down.on_create:
animate (this, 7, 4);
await timeout (4*3, this);
createTile(this.x / tile_size, this.y / tile_size + 1, "tip down");

tip right.on_create:
animate (this, 7, 4);
await timeout (4*3, this);
createTile(this.x / tile_size + 1, this.y / tile_size, "tip right");

tip up.on_create:
animate (this, 7, 4);
await timeout (4*3, this);
createTile(this.x / tile_size, this.y / tile_size - 1, "tip up");
